import React from 'react';
import './css/header.css';
import images from '../src/images/user.png';
import Header from './header';
const App = () => {
  return (
      <div className="main">
          <Header />>
          <content className="main">
              <div className="images">

              </div>
              <div className="container">
                  <div className="information-profile">
                      <div className="foto-profile">
                        <img src='https://www.clipartmax.com/png/full/103-1038980_bankers-and-professionals-meeting-regularly-for-luncheon-user-flat-icon-png.png'/>
                      </div>
                      <div className="data-user">
                          <div className="name">
                              <p>Dmitry K.</p>
                          </div>
                          <div className="birthday">Date of Birth: 2 january</div>
                          <div className="city">Minsk</div>
                          <div className="education">BSU'11</div>
                          <div className="WebSite">kenguruexpress.ru</div>
                      </div>
                  </div>
                  <div className="block-fast">
                      <div className="title-fast"><p>My posts</p></div>
                      <div className="text-pole">
                          <textarea></textarea>
                      </div>
                      <div className="button_add">
                        <button>Send</button>
                      </div>
                  </div>
                  <div className="block-comment">
                      <div className="img-icons-profile">

                      </div>
                      <div className="text-comment">
                          <p>Hello, my name is Ivan?</p>
                      </div>
                  </div>
              </div>

          </content>
          <footer className="footer">

          </footer>

      </div>

  );
}

// const Heading = () => {
//     return (
//         <div className="App">
//             <p>
//                 123456789
//             </p>
//         </div>
//     );
